import { Fragment, useContext, useEffect, useState } from 'react'
import { Navbar } from '../../Components'
import '../WishListPage/WishListPage.css'
import { Context } from "../../App";
import axios from 'axios';
import { ProfileCard } from '../../Components'

export const WishListPage = () => {


    const [UserDetailsContext, setUserDetailsContext] = useContext(Context);  
    const [profiles, setProfiles] = useState([]);

    useEffect(() => {
        // Check if UserDetailsContext is in local storage
        const storedUserDetails = localStorage.getItem('UserDetailsContext');
        if (storedUserDetails) {
          const parsedUserDetails = JSON.parse(storedUserDetails);
          setUserDetailsContext(parsedUserDetails);
        }
      }, []);

    useEffect( () => {
        (async () => {
            try {
                const {data} = await axios.get('http://localhost:3500/api/wishList', {params: {
                    "email":UserDetailsContext.email
                }})
                console.log('wishhh',data);
                setProfiles(data)
            } catch (error) {
                console.log(error)
            }
        } )();
    }, [UserDetailsContext])

    return (
        <Fragment>
            <Navbar/>
            <h3 className='heading-wishlist-page'>WishListPage</h3>
            <main className='main'>
            {
                profiles && profiles.map((profile) => <ProfileCard key={profile._id} profile={profile}/>)
            }
            </main>
        </Fragment>
    )
}
